INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1108501040, /*drama_id*/1108501, /*command_type*/11, /*param_01*/110811, /*param_02*/"で？　何なん、このケーキ。ウケる。\nハッ、クロエちゃん生誕記念つって？\nかー……マジかこーゆーことすんのか。\n不覚にもぴょんぴょん跳ねちゃったわ。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
