INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1108501043, /*drama_id*/1108501, /*command_type*/11, /*param_01*/110811, /*param_02*/"てかさ、コレさりげ手作り系じゃん。\nうそ、あんたが？　大変だったくない？\nいや呼びなって、こういうのは全然。\n二人でやった方のが色々アレじゃん。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
